from dateutil.parser import parse
from datetime import datetime

def convertToISO(dates):
    iso_dates = []
    for date in dates:
        try:
            iso_dates.append(parse(date).strftime('%Y-%m-%d'))
        except ValueError:
            iso_dates.append(f'{date}')
    return iso_dates
